import React from "react";
import { useAuth0 } from "@auth0/auth0-react";

const LoginButton = () => {
  const { loginWithRedirect } = useAuth0();

  return <button onClick={() => loginWithRedirect()}
            style={{background: '#8BB8E6',
                    border: 0,
                    borderRadius: 5,
                    height: '40%',
                    width: '10%'
                }}>
            Log In</button>;
};

export default LoginButton;
